  [],\n\t\"revision_timestamp\": \"2016-07-27T22:52:14.332433\",\n\t\"name\": \"lostwood-wetland-management-district-annual-narrative-report-calendar-year-1982\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Lostwood
  WMD and Shell Lake NWR outlines accomplishments during the 1982 calendar year. The
  report begins with a summary of the year's highlights and weather conditions. WMD
  administration is outlined; information about personnel, funding, and safety is
  given. Habitat management is also covered; subjects include wetlands, croplands,
  grasslands, grazing, fire management, pest control, and WPA easements. The wildlife
  section of the report discusses waterfowl, marsh birds and waterbirds, shorebirds,
  and raptors. The public uses of the District described in this report include interpretive
  programs and law enforcement. The equipment and facilities section of the report
  provides information about new construction, rehabilitation, and energy conservation.
  Cooperative programs are provided at the end.\",\n\t\"license_title\": \"License
